import React from 'react';

import Header from "../../helpers/Headers";
import TitleAndServices from "../../helpers/TitleAndServices";
import RowImages from "./RowImages";

function Portfolio(props) {
    const margin = {
        marginBottom:"5%",
    }
    return (
        <div className="body">
            <Header portfolio={true}></Header>
            <TitleAndServices title="Портфолио"></TitleAndServices>
            <div style={margin}></div>
            <RowImages></RowImages>
        </div>
    );
}

export default Portfolio;
